import { Box, Typography } from '@mui/material';

const Events = () => (
  <Box sx={{ p: 4 }}>
    <Typography variant="h4" gutterBottom>
      Eventet e Mia
    </Typography>
    <Typography variant="body1">
      Këtu do të shfaqen eventet tuaja. (Placeholder page)
    </Typography>
  </Box>
);

export default Events;
